from django.contrib.admin.sites import site as default_site

def register(*models, site=None):
    def inner_register(admin_class):
        for model in models:
            if site is None:
                default_site.register(model, admin_class)
            else:
                site.register(model, admin_class)
        return admin_class
    return inner_register

from django.template import engines
from django.template.exceptions import TemplateDoesNotExist

def select_template(template_name_list, using=None):
    if not isinstance(template_name_list, list):
        raise TypeError("Template names should be provided as a list.")

    if not template_name_list:
        raise TemplateDoesNotExist("No template names were provided.")

    for template_name in template_name_list:
        try:
            return engines[using].get_template(template_name)
        except TemplateDoesNotExist:
            pass

    attempted_names = ', '.join(template_name_list)
    raise TemplateDoesNotExist(f"TemplateDoesNotExist: Tried {attempted_names}")

