def url_params_from_lookup_dict(lookups):
    params = {}
    for key, value in lookups.items():
        if callable(value):
            value = value()
        elif isinstance(value, (list, tuple)):
            value = ','.join(str(v) for v in value)
        else:
            value = str(value)
        params[key] = value
    return params

def tag(*tags):
    def decorator(obj):
        if not hasattr(obj, 'tags'):
            obj.tags = set()
        obj.tags.update(tags)
        return obj
    return decorator

