import functools
from importlib import import_module
from django.core.exceptions import ViewDoesNotExist
from django.utils.module_loading import module_has_submodule

@functools.cache
def get_callable(lookup_view):
    if callable(lookup_view):
        return lookup_view
    elif isinstance(lookup_view, str):
        try:
            module_name, attr = lookup_view.rsplit('.', 1)
            module = import_module(module_name)
            if not module_has_submodule(module, attr):
                raise ViewDoesNotExist(f"Module '{module_name}' does not define a '{attr}' attribute")
            return getattr(module, attr)
        except (ImportError, AttributeError, ValueError) as e:
            raise ImportError(f"Could not import '{lookup_view}'. {e}")
    else:
        raise TypeError("Input must be a callable or a string representing a dotted path to a callable")

from http import cookies

def parse_cookie(cookie):
    cookie_dict = {}
    cookie_obj = cookies.SimpleCookie()
    cookie_obj.load(cookie)

    for key, morsel in cookie_obj.items():
        cookie_dict[key] = morsel.value

    return cookie_dict

from hashlib import md5

def make_template_fragment_key(fragment_name, vary_on=None):
    key = fragment_name
    if vary_on:
        hasher = md5()
        for var in vary_on:
            hasher.update(str(var).encode('utf-8'))
        key += '_' + hasher.hexdigest()
    return key

