def method_decorator(decorator, name=''):
    def _method_decorator(func):
        @wraps(func)
        def _wrapper(self, *args, **kwargs):
            return decorator(func)(self, *args, **kwargs)

        if name:
            setattr(self, name, _wrapper)
        else:
            setattr(self, func.__name__, _wrapper)

        return func

    return _method_decorator

